import React from 'react';
import './App.css';
// import TestApi from './components/TestApi';
import Navigation from './components/Navigation';
import Slideshow from './components/Slideshow';
import FooterPage from './components/FooterPage';

function App() {
  return (
    <div className="App">
      <Navigation/>
      <Slideshow/>
      <FooterPage/>
    </div>
  );
}

export default App;
